import Labs from "./Labs"
import HelloWorld from "./hello/HelloWorld"
import Kanbas from "./Kanbas";
import {HashRouter} from "react-router-dom";
import {Routes, Route, Navigate} from "react-router"
function App() {
    return (
        <HashRouter>
            <div>
                <HelloWorld/>
                <Labs/>
                <Kanbas/>
            </div>
        </HashRouter>
    );
}
export default App;
